'use strict';
let TradingTerminalBuilder = require('./TradingTerminalBuilder.js');
//@@DocBrief("The factory for creating trading terminals")
class TradingTerminalFactory {
    createTradingTerminal(type, name, status, inactiveText, urls, id, subId, description, salt, priceTerminal, chartTerminal) {
        let builder;
        builder = new TradingTerminalBuilder();
        builder.setType(type);
        builder.setName(name);
        builder.setStatus(status);
        builder.setInactiveText(inactiveText);
        builder.setUrls(urls);
        builder.setType(type);
        builder.setId(id);
        builder.setSubId(subId);
        builder.setDescription(description);
        builder.setSalt(salt);
        builder.setPriceTerminal(priceTerminal);
        builder.setChartTerminal(chartTerminal);
        return builder.build();
    }
    createTradingTerminalWithPriceTerminals(type, name, status, inactiveText, urls, id, subId, description, salt, priceTerminals, chartTerminal) {
        let builder;
        builder = new TradingTerminalBuilder();
        builder.setType(type);
        builder.setName(name);
        builder.setStatus(status);
        builder.setInactiveText(inactiveText);
        builder.setUrls(urls);
        builder.setType(type);
        builder.setId(id);
        builder.setSubId(subId);
        builder.setDescription(description);
        builder.setSalt(salt);
        builder.setPriceTerminals(priceTerminals);
        builder.setChartTerminal(chartTerminal);
        return builder.build();
    }
}
module.exports = TradingTerminalFactory
